import React from "react";
import {
    Nav, 
    NavLink,
    Bars, 
    NavMenu,
    NavBtn,
    NavBtnLink 
   

} from './NavbarElements';

const Navbar = () => {
    return (
        <>
        <Nav>
            <Bars/>
            <NavMenu>
                <NavLink to='/home' activeStyle>Home</NavLink>
                <NavLink to='/memo' activeStyle>Memo</NavLink>
                <NavLink to='/games' activeStyle>Games</NavLink>
                <NavLink to='/sign-up' activeStyle>Sign Up</NavLink>
            </NavMenu>
            <NavBtn>
                <NavBtnLink to='/signin'>Sign In</NavBtnLink>
            </NavBtn>
        </Nav>
        </>
    );
};

export default Navbar;
